import React, { useState } from 'react';

const Header = () => {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    return (
        <>
            {/* Bootstrap CSS - Add this to your index.html if not already included */}
            <link 
                href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" 
                rel="stylesheet"
            />
            <link 
                href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css" 
                rel="stylesheet"
            />

            <nav className="navbar navbar-expand-lg navbar-light bg-white sticky-top shadow-sm">
                <div className="container">
                    {/* Logo */}
                    <a className="navbar-brand fw-bold fs-3" href="/" style={{
                        background: 'linear-gradient(45deg, #2563eb, #06b6d4)',
                        WebkitBackgroundClip: 'text',
                        WebkitTextFillColor: 'transparent',
                        backgroundClip: 'text'
                    }}>
                        <i className="fas fa-heartbeat me-2 text-primary"></i>
                        MediCare Pro
                    </a>

                    {/* Mobile Toggle Button */}
                    <button 
                        className="navbar-toggler border-0 shadow-none" 
                        type="button"
                        onClick={toggleMenu}
                        style={{fontSize: '1.2rem'}}
                    >
                        <i className={`fas ${isMenuOpen ? 'fa-times' : 'fa-bars'} text-primary`}></i>
                    </button>

                    {/* Navigation Menu */}
                    <div className={`collapse navbar-collapse ${isMenuOpen ? 'show' : ''}`}>
                        <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <a className="nav-link fw-semibold px-3 py-2 rounded-3 mx-1" 
                                   href="/"
                                   style={{
                                       transition: 'all 0.3s ease',
                                       color: '#374151'
                                   }}
                                   onMouseEnter={(e) => {
                                       e.target.style.backgroundColor = '#f3f4f6';
                                       e.target.style.color = '#2563eb';
                                   }}
                                   onMouseLeave={(e) => {
                                       e.target.style.backgroundColor = 'transparent';
                                       e.target.style.color = '#374151';
                                   }}
                                >
                                    <i className="fas fa-home me-2"></i>Home
                                </a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link fw-semibold px-3 py-2 rounded-3 mx-1" 
                                   href="/doctors"
                                   style={{
                                       transition: 'all 0.3s ease',
                                       color: '#374151'
                                   }}
                                   onMouseEnter={(e) => {
                                       e.target.style.backgroundColor = '#f3f4f6';
                                       e.target.style.color = '#2563eb';
                                   }}
                                   onMouseLeave={(e) => {
                                       e.target.style.backgroundColor = 'transparent';
                                       e.target.style.color = '#374151';
                                   }}
                                >
                                    <i className="fas fa-user-md me-2"></i>Doctors
                                </a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link fw-semibold px-3 py-2 rounded-3 mx-1" 
                                   href="/services"
                                   style={{
                                       transition: 'all 0.3s ease',
                                       color: '#374151'
                                   }}
                                   onMouseEnter={(e) => {
                                       e.target.style.backgroundColor = '#f3f4f6';
                                       e.target.style.color = '#2563eb';
                                   }}
                                   onMouseLeave={(e) => {
                                       e.target.style.backgroundColor = 'transparent';
                                       e.target.style.color = '#374151';
                                   }}
                                >
                                    <i className="fas fa-clinic-medical me-2"></i>Services
                                </a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link fw-semibold px-3 py-2 rounded-3 mx-1" 
                                   href="/about"
                                   style={{
                                       transition: 'all 0.3s ease',
                                       color: '#374151'
                                   }}
                                   onMouseEnter={(e) => {
                                       e.target.style.backgroundColor = '#f3f4f6';
                                       e.target.style.color = '#2563eb';
                                   }}
                                   onMouseLeave={(e) => {
                                       e.target.style.backgroundColor = 'transparent';
                                       e.target.style.color = '#374151';
                                   }}
                                >
                                    <i className="fas fa-info-circle me-2"></i>About
                                </a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link fw-semibold px-3 py-2 rounded-3 mx-1" 
                                   href="/contact"
                                   style={{
                                       transition: 'all 0.3s ease',
                                       color: '#374151'
                                   }}
                                   onMouseEnter={(e) => {
                                       e.target.style.backgroundColor = '#f3f4f6';
                                       e.target.style.color = '#2563eb';
                                   }}
                                   onMouseLeave={(e) => {
                                       e.target.style.backgroundColor = 'transparent';
                                       e.target.style.color = '#374151';
                                   }}
                                >
                                    <i className="fas fa-phone me-2"></i>Contact
                                </a>
                            </li>
                        </ul>
                        
                        {/* CTA Button */}
                        <div className="d-flex ms-3">
                            <a 
                                href="/appointment" 
                                className="btn btn-primary px-4 py-2 rounded-pill fw-semibold"
                                style={{
                                    background: 'linear-gradient(45deg, #2563eb, #3b82f6)',
                                    border: 'none',
                                    boxShadow: '0 4px 12px rgba(37, 99, 235, 0.3)',
                                    transition: 'all 0.3s ease'
                                }}
                                onMouseEnter={(e) => {
                                    e.target.style.transform = 'translateY(-2px)';
                                    e.target.style.boxShadow = '0 8px 20px rgba(37, 99, 235, 0.4)';
                                }}
                                onMouseLeave={(e) => {
                                    e.target.style.transform = 'translateY(0)';
                                    e.target.style.boxShadow = '0 4px 12px rgba(37, 99, 235, 0.3)';
                                }}
                            >
                                <i className="fas fa-calendar-check me-2"></i>
                                Book Appointment
                            </a>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Custom styles for mobile responsiveness */}
            <style jsx>{`
                @media (max-width: 991.98px) {
                    .navbar-collapse {
                        margin-top: 1rem;
                        padding-top: 1rem;
                        border-top: 1px solid #e5e7eb;
                    }
                    .d-flex.ms-3 {
                        margin-top: 1rem !important;
                        margin-left: 0 !important;
                    }
                }
                
                .navbar-brand:hover {
                    transform: scale(1.05);
                    transition: transform 0.3s ease;
                }
                
                .navbar {
                    backdrop-filter: blur(10px);
                    background-color: rgba(255, 255, 255, 0.95) !important;
                }
            `}</style>
        </>
    );
};

export default Header;
